import React from 'react';
import {Field, reduxForm} from "redux-form";

const MassageForm = (props) => {
    return (
        <form onSubmit={props.handleSubmit}>
            <div>
                <Field placeholder={"Type a massage"} name={"massage"} component={"input"}/>
            </div>
            <div>
                <button onClick={props.onSubmit()}>Add massage</button>
            </div>
        </form>
    )
}
const MassageFormredux =  reduxForm({form: 'massage_form'})(MassageForm)

const MassageForm_component = (props) => {
    return <div>
        <MassageFormredux onSubmit={props.onSubmit} />
    </div>
}

export default MassageForm_component;
